// ProductList.jsx

import React from "react";
import ProductItem from "./ProductItem";

const ProductList = ({ productsData, onProductClick }) => {
  return (
    <div>
      {productsData.map((product) => (
        <ProductItem
          key={product.id}
          item={product}
          onProductClick={onProductClick}
        />
      ))}
    </div>
  );
};

export default ProductList;
